import { jsPDF } from "jspdf";
var font =
    "";
var callAddFont = function() {
    this.addFileToVFS("Montserrat-SemiBold-normal.ttf", font);
    this.addFont(
        "Montserrat-SemiBold-normal.ttf",
        "Montserrat-SemiBold",
        "normal"
    );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
